pragma solidity ^0.4.24;

contract AnonymousIdentityRegistry {

  struct Tag {
    uint x;
    uint y;
  }

  // key: listId
  mapping(bytes16 => address[8]) anonymousIdentityPool;
  mapping(bytes16 => uint256[8]) publicKeys;
  mapping(bytes16 => Tag[]) tags;
  address owner;

  constructor() public {
    owner = msg.sender;
  }

  modifier onlyOwner() {
    require(owner == msg.sender);
    _;
  }

  // function createList(bytes16 uuid, uint256[2][5] publicKeys) public onlyOwner {

  // }
  event Test(uint256 val);
  function test(uint256 val) returns (uint256) {
    emit Test(val);
    return val;
  }
}
